import React, { useState } from "react";

const Login = () => {
  return (
    <div>
      <form>
        <div>
          <p>Username:</p>
          <input type="text"></input>
        </div>
    
        <p>Password</p>
        <input type="text"></input>

        <button type="button">LOGIN</button>
      </form>
    </div>
  );
};
export default Login;
